import React from "react";

import Cards from "./cards";

const CardsList = ({ results, openPopup }) => {
  const click = () => {
    console.log("clicked");
  };
  return (
    <div className="style">
      <div className="row">
        {results.map((result) => (
          <Cards
            onclick={click}
            key={result.id}
            result={result}
            onclick={openPopup}
          />
        ))}
      </div>
    </div>
  );
};
export default CardsList;
